import React from "react";
import SummaryYouOwnContent from './SummaryYouOwnContent'
import ProfileImg2 from './profile2.jpeg'
import ProfileImg3 from './profile3.jpeg'

function SummaryYouOwn(){
    return (
        <div className="you-are-owe">
            <SummaryYouOwnContent url={ProfileImg2} amount="$61.50" name="twyio"/>
            <SummaryYouOwnContent url={ProfileImg3} amount="$61.50" name="twyio"/>
        </div>
    )
}

export default SummaryYouOwn
